import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Alert from "./Alert";

const Partners = () => {
  const [partners, setPartners] = useState([]);
  const [partnerType, setPartnerType] = useState("customer"); // Default to customers
  const [alert, setAlert] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch partners when the component mounts or partnerType changes
    const fetchPartners = async () => {
      try {
        const response = await fetch(`/partners?type=${partnerType}`);
        if (response.ok) {
          const data = await response.json();
          setPartners(data);
        } else {
          const errorData = await response.json();
          setAlert({
            type: "error",
            message: errorData.message || "Failed to fetch partners.",
          });
        }
      } catch (error) {
        setAlert({
          type: "error",
          message: "An error occurred while fetching partners.",
        });
      }
    };

    fetchPartners();
  }, [partnerType]);

  const handleEditPartner = (id) => {
    navigate(`/edit-partner?id=${id}`);
  };

  const handleAddPartner = () => {
    navigate(`/add-partner?type=${partnerType}`);
  };

  return (
    <div className="container mt-5">
      {alert && <Alert type={alert.type} message={alert.message} className="mb-4" />}
      <div className="card shadow-lg border-0">
        <div className="card-header bg-gradient-primary text-white">
          <h3 className="text-center mb-0">Partners</h3>
        </div>
        <div className="card-body">
          <div className="d-flex justify-content-between mb-3">
            <div>
              <label htmlFor="partnerType" className="form-label">
                Partner Type:
              </label>
              <select
                id="partnerType"
                className="form-select"
                value={partnerType}
                onChange={(e) => setPartnerType(e.target.value)}
              >
                <option value="customer">Customers</option>
                <option value="vendor">Vendors</option>
              </select>
            </div>
            <button className="btn btn-success" onClick={handleAddPartner}>
              <i className="fa fa-plus"></i> Add {partnerType === "customer" ? "Customer" : "Vendor"}
            </button>
          </div>
          {partners.length > 0 ? (
            <div className="table-responsive">
              <table className="table table-striped table-hover">
                <thead className="table-dark">
                  <tr>
                    <th>Full Name</th>
                    <th>Email</th>
                    <th>Contact No</th>
                    <th>Status</th>
                    <th>Opening Balance</th>
                    <th>Representative Name</th>
                    <th>Representative Contact</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {partners.map((partner) => (
                    <tr key={partner.id}>
                      <td>{`${partner.firstName} ${partner.lastName}`}</td>
                      <td>{partner.email}</td>
                      <td>{partner.contactNo}</td>
                      <td>{partner.status}</td>
                      <td>{partner.openingBalance}</td>
                      <td>{partner.repName}</td>
                      <td>{partner.repContact}</td>
                      <td>
                        <button
                          className="btn btn-primary"
                          onClick={() => handleEditPartner(partner.id)}
                        >
                          <i className="fa fa-edit"></i> Edit
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          ) : (
            <p className="text-center text-muted">No partners found.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Partners;
